import React from 'react'; 

function Profile() {
    return(
        <div> 
            <div class="bg-white rounded-xl max-w-xl mx-auto space-x-4">
                <h1>2019년 7월 10일</h1>
                <div>수요일</div>
                <div>할 일 2개 남음</div>
            </div>
        </div>
    );
}

export default Profile;
